import { useEffect, useState } from 'react';
import { fetchAnalysis } from './api';
import TweetCard from './TweetCard';

function App() {
  const [data, setData] = useState([]);
  useEffect(() => { fetchAnalysis().then(setData); }, []);
  return (
    <div>
      <h1>AI Social Engagement Bot</h1>
      {data.map((t,i) => <TweetCard key={i} {...t} />)}
    </div>
  );
}
export default App;
